import React from 'react'

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const MySoftSkills: React.FC<SlideProps> = ({ numberSlide, setNumberSlide }) => {
  return (
    <>
    <div className="slider-container header">
      <div className="wrapper">
      <h2 className="text-5xl my-8 text-center greeting font-medium ">
            My Soft Skills
          </h2>
      </div>
        <div className="icon" onClick={() => setNumberSlide(1)}>
          Next Slide
        </div>
        <div className="icon" onClick={() => setNumberSlide(3)}>
          Prev Slide
        </div>
      </div></>
  )
}

export default MySoftSkills
